/* eslint-disable react/prop-types */
import Navbar from "./Navbar/Navbar";
const Layout = ({ Component, pageProps }) => {
  return (
    <div>
      <Navbar />
      <Component> {pageProps} </Component>
    </div>
  );
};
export default Layout;
